query searchPageQuery($_v0_query: String!, $_v1_page: Int) {
  search(query: $_v0_query, page: $_v1_page) {
    totalResults
    query
    resultItems {
      id
      name
      url
      __typename
      ... on CompanyResultItem {
        tickerSymbol
        __typename
      }
      ... on EventResultItem {
        startTime
        endTime
        __typename
      }
      ... on VideoResultItem {
        timestamp
        __typename
      }
      ... on ResearchArticleResultItem {
        timestamp
        authorName
        authorTitle
        type
        __typename
      }
    }
    __typename
  }
}
